"use strict";const removeError=()=>{document.getElementById("error").style.opacity=0,document.getElementById("error-input").classList.remove("has-error")},authorized=async()=>{const a=document.getElementById("user").value,b=document.getElementById("passwd").value;if(!a)alert("User cannot be null");else if(!b)alert("You cannot have blink passsword");else{const c=new Headers;c.append("Content-Type","application/json"),c.append("Access-Control-Allow-Origin","*");const d=JSON.stringify({user:`${a}`,passwd:`${b}`});try{await fetch(`/oauth`,{method:"POST",headers:c,body:d,redirect:"follow"}).then(a=>a.json()).then(a=>{!1===a?(document.getElementById("error").style.opacity=100,document.getElementById("error-input").classList.toggle("has-error")):window.location.href="/"})}catch(a){document.getElementById("error").style.opacity=100,console.log("error:"+a)}}};addEventListener("keypress",function(a){"Enter"===a.key&&authorized()});